import { userGrid } from '@sudoku/stores/grid';
import { hiddenSingle, nakedSingle, possibleNumberSolver } from '@sudoku/solver';

export function hiddenSingleTest() {
    let grid = get(userGrid);
    const candidates = getPossibleNumber(grid);
    console.log(hiddenSingle(candidates));
}

export function nakedSingleTest() {
    let grid = get(userGrid);
    const candidates = getPossibleNumber(grid);
    console.log(nakedSingle(candidates));
}

export function possibleNumberSolverTest() {
    let grid = get(userGrid);
    console.log(possibleNumberSolver(grid));
}






